  let time;

    if(hours < 12)
    {
        time = "Morning";
    }
    else if(hours >=12 && hours < 17)
    {
        time = "After Noon";
    }
    else 
    {
        time = "Night !!!";
    }
    return(
    <h1>Good {time}</h1>
